// Função para exibir os filmes na div "root".
function exibirFilmes(filmesArray) {
    root.innerHTML = '';

    filmesArray.slice(0, 10).forEach((filme) => {
        const card = document.createElement('div');
        card.classList.add('card');

        const imagem = document.createElement('img');
        imagem.src = filme.imagem;
        card.appendChild(imagem);

        const titulo = document.createElement('h2');
        titulo.textContent = filme.titulo;
        card.appendChild(titulo);

        root.appendChild(card);
    });
}

exibirFilmes(filmes);

// Função para filtrar os filmes por gênero.
function filtrarFilmesPorGenero(genero) {
    const filmesFiltrados = filmes.filter((filme) => filme.genero.toLowerCase() === genero.toLowerCase());
    exibirFilmes(filmesFiltrados);
}

// Adicionar um evento de clique ao botão de filtro.
filterButton.addEventListener('click', () => {
    const generoFiltrado = genreFilterInput.value;
    filtrarFilmesPorGenero(generoFiltrado);
});
